    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <script>
        function pulaLinha(){
            document.write('<br>')
        }
        function print(texto){
            document.write(texto)
            pulaLinha()
        }

        var inicio = 29

        while(inicio <=39){
            inicio = inicio + 1
            if (inicio != 33 && inicio != 37)
            print(inicio)

        }



    </script>
